        }
        .section {
            margin: 30px 0;
            background: rgba(0, 0, 0, 0.5);

            margin-bottom: 15px;

<body>

<h1> Please Follow PokeSpot!!! </h1>
<h2> SAR Always LIVE!!!<h2>

<div class="section">
    <h2> SR </h2>
    <div id="srContainer"></div>
</div>

<div class="section">
    <h2> AR </h2>
    <div id="arContainer"></div>
</div>

<script>
    document.addEventListener("DOMContentLoaded", function () {
        let srCount = 2;
        let arCount = 6;

        const srContainer = document.getElementById('srContainer');
        const arContainer = document.getElementById('arContainer');

        function renderCounters(container, count, symbol, emptySymbol) {
            container.innerHTML = '';
            for (let i = 0; i < count; i++) {
                const span = document.createElement('span');
                span.textContent = symbol;
                span.className = 'counter';
                span.onclick = function () {
                    span.classList.add('fade-out');
                    setTimeout(() => {
                        span.textContent = emptySymbol;
                        span.classList.remove('fade-out');
                    }, 300);
                };
                container.appendChild(span);
            }
        }

        renderCounters(srContainer, srCount, '', '');
        renderCounters(arContainer, arCount, '', '');
    });
</script>

</body>
